import React,{useState} from 'react'
import { Form, Input, Button, Row, Col } from 'antd';
import {  LockOutlined } from '@ant-design/icons';
import SubSelect from './subSelect'
import Category from './Category'
import SubCategory from './SubCategory'
export default function NormalLoginForm() {
  const [value,setValue] =useState(1)
    const onFinish = (values) => {
      console.log('Received values of form: ', values);
    };

    return (
      <Form
        name="normal_login"
        className="login-form"
        initialValues={{
          remember: true,
        }}
            onFinish={onFinish}
            style={{background:"white",padding:14}}
        >
            <Form.Item  style={{fontSize:'1.06rem',fontWeight:500}}>
                ประเภทร้านค้า
             </Form.Item>
        <Form.Item >   
          <Category value={value} setValue={ setValue}/>
            </Form.Item>
            <Form.Item>
                <SubSelect />
            </Form.Item>
        <Form.Item>
          <>ช่วงราคาสินค้า (บาท)</>
        <Row gutter={8}>
        <Col span={11}>
          <Input defaultValue="ราคาต่ำสุด" />
                    </Col>
                    -
        <Col span={12}>
          <Input defaultValue="ราคาสูงสุด" />
        </Col>
      </Row>
        </Form.Item>
        <Form.Item >   
          <SubCategory value={value} />
            </Form.Item>
        <Form.Item>
          <Button type="default" htmlType="submit" className="login-form-button" style={{width:'100%'}}>
            ตกลง
          </Button>

        </Form.Item>
      </Form>
    );
  };
